function hasAdjectiveDeclension(noun, gender = 'm') {
  if (
    gender === 'f' || !endsWith(noun, 'e') ||
    /(wochen|monats|jahres)?(ende)$/i.test(noun) || /(live|nature|single|experte|gefährte)$/i.test(noun)
  ) {
    return false
  }
  noun = noun.toLowerCase().replace(/e$/,'');
  const ratherHasNoun = endsWith(noun, 'tt','at','ät','ot','öt','ut','üt');

  return mightBeAdjective(noun)
}

